import React from 'react';
import { Typography, Box } from '@mui/material';
import BlogList from '../components/BlogList';

function Blog() {
  return (
    <Box sx={{ width: '100vw', minHeight: '100vh', px: { xs: 1, sm: 2, md: 4 }, py: 0, bgcolor: '#f8fafc' }}>
      <Typography variant="h4" gutterBottom sx={{ mt: 2 }}>Career Blog</Typography>
      <BlogList />
      <Typography variant="body1" color="text.secondary" sx={{ mt: 2 }}>Read the latest career tips and industry news.</Typography>
    </Box>
  );
}

export default Blog;
